import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import ProfilePage from './pages/ProfilePage';
import InvestorPage from './pages/InvestorPage';
import StartupPage from './pages/StartupPage';
import AllStartupsPage from './pages/AllStartupsPage';
import AllInvestorsPage from './pages/AllInvestorsPage';
import BlogPage from './pages/BlogPage';
import AllBlogsPage from './pages/AllBlogsPage';
import { AuthContext } from './context/AuthContext';
import './index.css';
import ProtectedRoute from './components/ProtectedRoute';
import React, { useContext } from 'react';

function App() {
  const { user } = useContext(AuthContext);

  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/AllBlogs" element={<AllBlogsPage />} />
        <Route path="/AllStartups" element={<AllStartupsPage user={user}  />} />
        <Route path="/AllInvestors" element={<AllInvestorsPage />} />

        <Route path="/profile" element={<ProtectedRoute element={<ProfilePage />} />} />
        <Route path="/investor" element={<ProtectedRoute element={<InvestorPage />} allowedProfessions={['investor']} />} />
        <Route path="/startup" element={<ProtectedRoute element={<StartupPage />} allowedProfessions={['founder']} />} />
        <Route path="/blog" element={<ProtectedRoute element={<BlogPage />} />} />
      </Routes>
    </Router>
  );
}

export default App;
